import React,{Component} from 'react';

class UserGreeting extends Component{
    constructor(props) {
        super(props);
        this.state={
            loggedIn:true
        }
    }
    render(){
        if(this.state.loggedIn){
            return(
                <div>Welcome Pratim</div>
            );
        }
        else{
            return(
                <div>Welcome User</div>
            );
        }
/*        return(
